No es lo mismo dinga, que mandiga.  Una cosa es Estados Unidos de América y otra es Estados Unidos Distrito de Columbia (Federal).  Estados Unidos D.C. es una corporación privada que brinda servicios gubernamentales pero no es el gobierno de jure de Estados Unidos de América.  Puerto Rico no está ni nunca ha estado bajo Estados Unidos D.C. y sí bajo Estados Unidos de América y la  Constitución para los Estados Unidos de América ratificada en 1789. Eso hace una gran diferencia. 

Estados Unidos DC (U.S.), no es equivalente a la República de Estados Unidos de América (U.S.A.).  “…Estados Unidos está ubicado en el Distrito de Columbia…”, ver 9 USC 307(h).  El denominado territorio federal comprende exclusivamente las 10 millas cuadradas ubicadas entre el estado de  Maryland, U.S.A. y el estado de Virginia, U.S.A. Además, el territorio federal también comprende los lugares “comprados”—los cuales tendrían que ser evidenciados con sus correspondientes Escrituras de Compraventa—pero no comprende las 100 millas por 35 millas que componen las tierras de la isla de Puerto Rico.  Cabe aclarar que Estados Unidos Distrito de Columbia nunca ha “comprado” todas  las tierras de Puerto Rico y no tiene Escrituras de Compraventa que así lo validen.  Por consiguiente, Puerto Rico no es un territorio de Estados Unidos, como erróneamente se dice, con excepción de:  
(a)	sus franquicias, tales como el Commonwealth de Puerto Rico o Estado Libre Asociado de Puerto Rico, corporación privada desde 1953 con número de registro corporativo DUNS #118162700.  Vea la página web de Dunn & Bradstreet (D&B);   
(b) sus organizaciones registradas o personas jurídicas, como los Certificados de Nacimientos—cuyo nombre se escribe todo en letras mayúsculas—lo que son bonos o instrumentos negociables, y nada tienen que ver con los  hombres y mujeres vivos;  
(c)  sus ciudadanos US Citizens, quienes quizás por desconocimiento, se hacen pasar por su persona jurídica (organización registrada del Certificado de Nacimiento). Cabe señalar que en el Código Penal de Puerto Rico, Artículo 208 este delito se tipifica como Impostura:  “Toda persona que con intención de engañar se haga pasar por otra o la represente y bajo este carácter realice cualquier acto no autorizado por la persona falsamente representada. En los casos en que la persona representada haya prestado su consentimiento para la impostura, ésta incurrirá también en el delito de impostura.”   También vea Código Criminal  1899, Sec 514 (Criminal Code 1899 - Sect 514), Personificación (Personation):  “…Cualquier persona que, con la intención de defraudar a otra persona, se presente falsamente como otra persona, viva o muerta, real o ficticia, es culpable de un delito que, a menos que se indique lo contrario, es un delito menor, y el persona está sujeta a prisión por 3 años…”.  Además, refiérase a 18 USC Capítulo 43-Falso Personaje;  
(d)	sus residentes y empleados federales: ciudadanos US Citizens, quienes, quizás por desconocimiento, han abandonado la tierra de Puerto Rico para convertirse en residentes y empleados federales del Distrito de Columbia en Washington.  

Entiéndase que Washington DC no es parte de ninguno de los 50 estados soberanos de la República de los Estados Unidos de América. “Washington, D.C., sigue siendo un territorio, no un estado, y desde 1974 ha sido gobernado por un alcalde y un concejo  municipal (concejales de ayuntamiento o corporación municipal) elegidos localmente, sobre los cuales el Congreso conserva el poder de veto”.  El Artículo I, Sección 8, Cláusula 17 de la Constitución de los Estados Unidos, la cual se cita de la siguiente manera: "El Congreso tendrá la facultad*** de ejercer legislación exclusiva en todos los casos, sea cual sea, sobre tal distrito (SIN EXCEDER DIEZ MILLAS CUADRADAS) que, por cesión de estados particulares y la aceptación del Congreso, se convierta en la sede del Gobierno de los Estados Unidos, [Distrito de Columbia] y ejercer como autoridad sobre todos los lugares comprados con el consentimiento de la legislatura del estado en el que se encuentren, para la Erección de Fuertes, Almacenes, Arsenales, astilleros portuarias y otros edificios necesarios... " 

Estados Unidos federal está incorporada en el estado de Delaware desde el 1869 y brinda servicios gubernamentales por mandato del Congreso de los Estados Unidos de América, mediante el “District of Columbia Act of 1871”.  Esta corporación federal, establecida en el Distrito de Columbia, a su vez ha incorporado numerosas franquicias privadas, incorporadas en diversos estados y en diversos países, tales como FEMA, Home Land Security, FBI, CIA, CDC, y todas las demás agencias federales que hoy conocemos. 

Una corporación no es una persona viva, sino una entidad jurídica o “persona”, según se define en 28 USC 3002(15)(A): "... ESTADOS UNIDOS significa una corporación Federal ...", ver su número corporativo: D.U.N.S.  #052714196. Una corporación es diferente a un hombre o mujer, por lo tanto, no tiene los mismos derechos que un individuo, específicamente no tiene los derechos que son equivalentes a los derechos humanos.

Lamentablemente mas de la mitad de los españoles están "averiados" y  viven en una realidad  manipulada por los medios de comunicación y no ven la autentica realidad que tenemos a nuestro alrededor ...
Antiguamente cuando los televisores viejos perdían la señal de TV, se arreglaban dándoles un golpecito al aparato; 
hay cosas que solo se arreglan a golpes .... (filosóficamente hablando)
